import React from 'react';
import { motion } from 'framer-motion';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import './Home.css'; // Assurez-vous d'adapter ou de créer un nouveau fichier Home.css

// Données (à extraire potentiellement dans des fichiers séparés)
const heroData = {
    title: "Votre Partenaire de Confiance pour une Rénovation Digitale",
    subtitle: "Des solutions web innovantes et sur mesure pour propulser votre présence en ligne.",
    image: "https://www.futurdigital.fr/wp-content/uploads/2024/09/agence-web-futur-digital.webp", // Exemple d'image de Futur Digital
    buttonText: "Découvrir nos services",
    buttonLink: "#services"
};

const servicesData = [
    {
        title: "Création de Sites Web",
        description: "Sites web modernes, responsives et optimisés pour le SEO.",
        icon: "fas fa-code" // Exemple d'icône Font Awesome (nécessite l'intégration de la librairie)
    },
    {
        title: "Référencement SEO",
        description: "Améliorez votre visibilité sur les moteurs de recherche et attirez plus de clients.",
        icon: "fas fa-search"
    },
    {
        title: "Webdesign UX/UI",
        description: "Expériences utilisateur intuitives et interfaces esthétiques.",
        icon: "fas fa-paint-brush"
    },
    {
        title: "Marketing Digital",
        description: "Stratégies de marketing en ligne efficaces pour atteindre vos objectifs.",
        icon: "fas fa-chart-line"
    },
    // Ajoutez d'autres services en vous inspirant de Futur Digital
];

const realizationsData = [
    {
        image: "https://www.futurdigital.fr/wp-content/uploads/2024/10/creation-site-web-vitrine-agence-futur-digital-nice.webp",
        legend: "Site web vitrine pour une entreprise locale"
    },
    {
        image: "https://www.futurdigital.fr/wp-content/uploads/2024/10/refonte-site-web-agence-futur-digital-cannes.webp",
        legend: "Refonte de site web e-commerce"
    },
    // Ajoutez d'autres réalisations
];

const contactData = {
    title: "Prêt à Transformer Votre Présence en Ligne ?",
    description: "Contactez-nous pour discuter de votre projet digital.",
    email: "contact@votresite.fr",
    phone: "01 23 45 67 89",
    buttonText: "Demander un devis gratuit",
    buttonLink: "#contact-form" // Créez un formulaire de contact si nécessaire
};

const Home = () => {
    return (
        <div className="home futur-digital-inspired">
            {/* Hero Section */}
            <motion.section
                id="hero"
                className="hero-section"
                style={{
                    backgroundImage: `url(${heroData.image})`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center'
                }}
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ duration: 1 }}
            >
                <div className="hero-overlay" />
                <div className="hero-content">
                    <motion.h1
                        initial={{ y: -50, opacity: 0 }}
                        animate={{ y: 0, opacity: 1 }}
                        transition={{ delay: 0.5, duration: 0.8 }}
                    >
                        {heroData.title}
                    </motion.h1>
                    <motion.p
                        initial={{ y: 50, opacity: 0 }}
                        animate={{ y: 0, opacity: 1 }}
                        transition={{ delay: 0.7, duration: 0.8 }}
                    >
                        {heroData.subtitle}
                    </motion.p>
                    <motion.button
                        initial={{ scale: 0, opacity: 0 }}
                        animate={{ scale: 1, opacity: 1 }}
                        transition={{ delay: 0.9, duration: 0.6, type: 'spring', stiffness: 120 }}
                    >
                        <a href={heroData.buttonLink}>{heroData.buttonText}</a>
                    </motion.button>
                </div>
            </motion.section>

            {/* Services Section */}
            <motion.section id="services" className="services-section">
                <motion.h2
                    initial={{ opacity: 0, y: 50 }}
                    whileInView={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.8 }}
                >
                    Nos Services
                </motion.h2>
                <div className="services-grid">
                    {servicesData.map((service, index) => (
                        <motion.div
                            key={index}
                            className="service-card"
                            initial={{ opacity: 0, scale: 0.8 }}
                            whileInView={{ opacity: 1, scale: 1 }}
                            transition={{ duration: 0.6, delay: index * 0.1 }}
                        >
                            <div className="service-icon">
                                <i className={service.icon}></i> {/* Intégrez Font Awesome pour les icônes */}
                            </div>
                            <h3>{service.title}</h3>
                            <p>{service.description}</p>
                            <motion.button className="learn-more">En savoir plus</motion.button>
                        </motion.div>
                    ))}
                </div>
            </motion.section>

            {/* Realizations Section */}
            <motion.section id="realisations" className="realizations-section">
                <motion.h2
                    initial={{ opacity: 0, y: 50 }}
                    whileInView={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.8 }}
                >
                    Nos Réalisations
                </motion.h2>
                <Carousel
                    autoPlay
                    infiniteLoop
                    showThumbs={false}
                    showStatus={false}
                    className="realizations-carousel"
                >
                    {realizationsData.map((realization, index) => (
                        <div key={index}>
                            <img src={realization.image} alt={`Réalisation ${index + 1}`} />
                            <p className="legend">{realization.legend}</p>
                        </div>
                    ))}
                </Carousel>
            </motion.section>

            {/* Contact Section */}
            <motion.section id="contact" className="contact-section">
                <div className="contact-container">
                    <motion.div
                        className="contact-info"
                        initial={{ opacity: 0, x: -50 }}
                        whileInView={{ opacity: 1, x: 0 }}
                        transition={{ duration: 0.7 }}
                    >
                        <h2>{contactData.title}</h2>
                        <p>{contactData.description}</p>
                        <p>Email : <a href={`mailto:${contactData.email}`}>{contactData.email}</a></p>
                        <p>Téléphone : {contactData.phone}</p>
                        <motion.button className="contact-button">
                            <a href={contactData.buttonLink}>{contactData.buttonText}</a>
                        </motion.button>
                    </motion.div>
                    { <motion.div
                        className="contact-form"
                        initial={{ opacity: 0, x: 50 }}
                        whileInView={{ opacity: 1, x: 0 }}
                        transition={{ duration: 0.7, delay: 0.2 }}
                    >
                        <h2>Formulaire de Contact</h2>
                        <form id="contact-form">
                            {/* ... vos champs de formulaire ... */}
                </form>
            </motion.div> }
        </div>
</motion.section>

    {/* Footer */}
    <footer className="footer futur-digital-inspired">
        <p>© 2025 RÉNOV+ - Tous droits réservés</p>
        {/* Ajouter potentiellement des liens vers les réseaux sociaux comme Futur Digital */}
    </footer>
</div>
);
};

export default Home;
